		LEFT JOIN 1_ivrs iv on i.ivrsid = iv.ivrsid
		LEFT JOIN 1_employee e on e.eid=f.eid
		WHERE  f.type='ivrs' and f.followupdate >= CURRENT_DATE() AND f.followupdate <= (CURRENT_DATE()+INTERVAL 6 DAY)
		UNION
		select p.name as callername,p.callfrom as callfrom,f.followupdate as followupdate,f.callid as callid,e.eid as eid,e.empname as empname,px.pbxid as gid,px.title as groupname,f.type as source from 1_followup f
