		LEFT JOIN 1_pbx px on p.pbxid=px.pbxid
		LEFT JOIN 1_employee e on e.eid=f.eid WHERE  f.type='pbx' and f.followupdate >= CURRENT_DATE() AND f.followupdate <= (CURRENT_DATE()+INTERVAL 6 DAY)
		UNION 
		SELECT l.name as callername,l.number as callfrom,lf.followupdate as followupdate,l.leadid as callid,e.eid as eid,e.empname as empname,g.gid as gid,g.groupname as groupname,lf.type as source
		FROM 1_followup lf 
		LEFT JOIN 1_leads l on lf.callid = l.leadid 
		LEFT JOIN 1_leads_groups g on l.gid = g.gid 
		LEFT JOIN 1_employee e on e.eid=l.assignto
		WHERE   lf.followupdate >= CURRENT_DATE() 
		AND lf.followupdate <= (CURRENT_DATE()+INTERVAL 6 DAY)
		AND  lf.type='leads'
		UNION
