		LEFT JOIN 1_support_tickets t on f.callid = t.tktid 
		LEFT JOIN 1_support_groups g on t.gid = g.gid 
		LEFT JOIN 1_employee e on e.eid=t.assignto
		WHERE  f.type='support' AND f.followupdate >= CURRENT_DATE() 
